s.org">Useful Info ↗</a></strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Get to know our opening times, ticket prices and discounts.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->";}i:37;O:8:"stdClass":7:{s:2:"id";i:199;s:5:"title";O:8:"stdClass":1:{s:8:"rendered";s:34:"Three columns with images and text";}s:7:"content";O:8:"stdClass":2:{s:8:"rendered";s:3155:"\n<div class="wp-block-group alignfull has-background is-layout-flow wp-block-group-is-layout-flow" style="background-color:#f8f4e4">\n<div class="wp-block-columns alignwide is-layout-flex wp-container-217 wp-block-columns-is-layout-flex">\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow">\n<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n\n\n\n<h6 class="has-text-color wp-block-heading" id="ecosystem" style="color:#000000">ECOSYSTEM</h6>\n\n\n\n<p class="has-text-color" style="color:#000000;font-size:5vw;line-height:1.1"><strong>Positive growth.</strong></p>\n\n\n\n<div style="height:5px" aria-hidden="true" class="wp-block-spacer"></div>\n</div>\n</div>\n\n\n\n<div class="wp-block-columns alignwide is-layout-flex wp-container-221 wp-block-columns-is-layout-flex">\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:33.38%">\n<p class="has-text-color has-extra-small-font-size" style="color:#000000"><em>Nature</em>, in the common sense, refers to essences unchanged by man; space, the air, the river, the leaf.&nbsp;<em>Art</em>&nbsp;is applied to the mixture of his will with the same things, as in a house, a canal, a statue, a picture. But his operations taken together are so insignificant, a little chipping, baking, patching, and washing, that in an impression so grand as that of the world on the human mind, they do not vary the result.</p>\n</div>\n\n\n\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:33%">\n<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n\n\n\n<figure class="wp-block-image size-large"><img decoding="async" src="https://s.w.org/images/core/5.8/outside-01.jpg" alt="The sun setting through a dense forest." /></figure>\n</div>\n\n\n\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:33.62%">\n<figure class="wp-block-image size-large"><img decoding="async" src="https://s.w.org/images/core/5.8/outside-02.jpg" alt="Wind turbines standing on a grassy plain, against a blue sky." /></figure>\n</div>\n</div>\n\n\n\n<div class="wp-block-columns alignwide is-layout-flex wp-container-224 wp-block-columns-is-layout-flex">\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:67%">\n<div class="wp-block-image"><figure class="alignright size-large"><img decoding="async" src="https://s.w.org/images/core/5.8/outside-03.jpg" alt="The sun shining over a ridge leading down into the shore. In the distance, a car drives down a road." /></figure></div>\n</div>\n\n\n\n<div class="wp-block-column is-vertically-aligned-center is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:33%">\n<p class="has-text-color has-extra-small-font-size" style="color:#000000">Undoubtedly we have no questions to ask which are unanswerable. We must trust the perfection of the creation so far, as to believe that whatever curiosity the order of things has awakened in our minds, the order of things can satisfy. Every man&#8217;s condition is a solution in hieroglyphic to those inquiries he would put.</p>\n</div>\n</div>\n</div>\n";s:9:"protected";b:0;}s:4:"meta";O:8:"stdClass":7:{s:13:"wpop_keywords";s:0:"";s:16:"wpop_description";s:77:"Three columns with images and text, with vertical spacing for an offset look.";s:19:"wpop_viewport_width";i:1200;s:16:"wpop_block_types";a:0:{}s:11:"wpop_locale";s:5:"en_US";s:15:"wpop_wp_version";s:0:"";s:25:"wpop_contains_block_types";s:86:"core/column,core/columns,core/group,core/heading,core/image,core/paragraph,core/spacer";}s:14:"category_slugs";a:2:{i:0;s:7:"columns";i:1;s:8:"featured";}s:13:"keyword_slugs";a:2:{i:0;s:4:"core";i:1;s:8:"featured";}s:15:"pattern_content";s:3990:"<!-- wp:group {"align":"full","style":{"color":{"background":"#f8f4e4"}}} -->\n<div class="wp-block-group alignfull has-background" style="background-color:#f8f4e4"><!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:spacer -->\n<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"level":6,"style":{"color":{"text":"#000000"}}} -->\n<h6 class="has-text-color" id="ecosystem" style="color:#000000">ECOSYSTEM</h6>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {"style":{"typography":{"lineHeight":"1.1","fontSize":"5vw"},"color":{"text":"#000000"}}} -->\n<p class="has-text-color" style="color:#000000;font-size:5vw;line-height:1.1"><strong>Positive growth.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":"5px"} -->\n<div style="height:5px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column {"width":"33.38%"} -->\n<div class="wp-block-column" style="flex-basis:33.38%"><!-- wp:paragraph {"style":{"color":{"text":"#000000"}},"fontSize":"extra-small"} -->\n<p class="has-text-color has-extra-small-font-size" style="color:#000000"><em>Nature</em>, in the common sense, refers to essences unchanged by man; space, the air, the river, the leaf.&nbsp;<em>Art</em>&nbsp;is applied to the mixture of his will with the same things, as in a house, a canal, a statue, a picture. But his operations taken together are so insignificant, a little chipping, baking, patching, and washing, that in an impression so grand as that of the world on the human mind, they do not vary the result.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {"width":"33%"} -->\n<div class="wp-block-column" style="flex-basis:33%"><!-- wp:spacer -->\n<div style="height:100px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:image {"sizeSlug":"large","linkDestination":"none"} -->\n<figure class="wp-block-image size-large"><img src="https://s.w.org/images/core/5.8/outside-01.jpg" alt="The sun setting through a dense forest." /></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {"width":"33.62%"} -->\n<div class="wp-block-column" style="flex-basis:33.62%"><!-- wp:image {"sizeSlug":"large","linkDestination":"none"} -->\n<figure class="wp-block-image size-large"><img src="https://s.w.org/images/core/5.8/outside-02.jpg" alt="Wind turbines standing on a grassy plain, against a blue sky." /></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column {"width":"67%"} -->\n<div class="wp-block-column" style="flex-basis:67%"><!-- wp:image {"align":"right","sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignright size-large"><img src="https://s.w.org/images/core/5.8/outside-03.jpg" alt="The sun shining over a ridge leading down into the shore. In the distance, a car drives down a road." /></figure></div>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {"verticalAlignment":"center","width":"33%"} -->\n<div class="wp-block-column is-vertically-aligned-center" style="flex-basis:33%"><!-- wp:paragraph {"style":{"color":{"text":"#000000"}},"fontSize":"extra-small"} -->\n<p class="has-text-color has-extra-small-font-size" style="color:#000000">Undoubtedly we have no questions to ask which are unanswerable. We must trust the perfection of the creation so far, as to believe that whatever curiosity the order of things has awakened in our minds, the order of things can satisfy. Every man\'s condition is a solution in hieroglyphic to those inquiries he would put.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->";}i:38;O:8:"stdClass":7:{s:2:"id";i:197;s:5:"title";O:8:"stdClass":1:{s:8:"rendered";s:39:"Two columns of text with offset heading";}s:7:"content";O:8:"stdClass":2:{s:8:"rendered";s:2240:"\n<div class="wp-block-group alignfull has-background is-layout-flow wp-block-group-is-layout-flow" style="background-color:#f2f0e9">\n<div style="height:70px" aria-hidden="true" class="wp-block-spacer"></div>\n\n\n\n<div class="wp-block-columns alignwide are-vertically-aligned-center is-layout-flex wp-container-228 wp-block-columns-is-layout-flex">\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:50%">\n<p class="has-text-color" style="color:#000000;font-size:30px;line-height:1.1"><strong>Oceanic Inspiration</strong></p>\n</div>\n\n\n\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow" style="flex-basis:50%">\n<hr class="wp-block-separator has-text-color has-background is-style-wide" style="background-color:#000000;color:#000000" />\n</div>\n</div>\n\n\n\n<div class="wp-block-columns alignwide is-layout-flex wp-container-232 wp-block-columns-is-layout-flex">\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow"></div>\n\n\n\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow">\n<p class="has-text-color has-extra-small-font-size" style="color:#000000">Winding veils round their heads, the women walked on deck. They were now moving steadily down the river, passing the dark shapes of ships at anchor, and London was a swarm of lights with a pale yellow canopy drooping above it. There were the lights of the great theatres, the lights of the long streets, lights that indicated huge squares of domestic comfort, lights that hung high in air.</p>\n</div>\n\n\n\n<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow">\n<p class="has-text-color has-extra-small-font-size" style="color:#000000">No darkness would ever settle upon those lamps, as no darkness had settled upon them for hundreds of years. It seemed dreadful that the town should blaze for ever in the same spot; dreadful at least to people going away to adventure upon the sea, and beholding it as a circumscribed mound, eternally burnt, eternally scarred. From the deck of the ship the great city appeared a crouched and cowardly figure, a sedentary miser.</p>\n</div>\n</div>\n\n\n\n<div style="height:40px" aria-hidden="true" class="wp-block-spacer"></div>\n</div>\n";s:9:"protected";b:0;}s:4:"meta";O:8:"stdClass":7:{s:13:"wpop_keywords";s:0:"";s:16:"wpop_description";s:43:"Two columns of text with an offset heading.";s:19:"wpop_viewport_width";i:1200;s:16:"wpop_block_types";a:0:{}s:11:"wpop_locale";s:5:"en_US";s:15:"wpop_wp_version";s:0:"";s:25:"wpop_contains_block_types";s:77:"core/column,core/columns,core/group,core/paragraph,core/separator,core/spacer";}s:14:"category_slugs";a:2:{i:0;s:7:"columns";i:1;s:4:"text";}s:13:"keyword_slugs";a:2:{i:0;s:4:"core";i:1;s:8:"featured";}s:15:"pattern_content";s:2837:"<!-- wp:group {"align":"full","style":{"color":{"background":"#f2f0e9"}}} -->\n<div class="wp-block-group alignfull has-background" style="background-color:#f2f0e9"><!-- wp:spacer {"height":70} -->\n<div style="height:70px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"verticalAlignment":"center","align":"wide"} -->\n<div class="wp-block-columns alignwide are-vertically-aligned-center"><!-- wp:column {"width":"50%"} -->\n<div class="wp-block-column" style="flex-basis:50%"><!-- wp:paragraph {"style":{"typography":{"lineHeight":"1.1","fontSize":"30px"},"color":{"text":"#000000"}}} -->\n<p class="has-text-color" style="color:#000000;font-size:30px;line-height:1.1"><strong>Oceanic Inspiration</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {"width":"50%"} -->\n<div class="wp-block-column" style="flex-basis:50%"><!-- wp:separator {"customColor":"#000000","className":"is-style-wide"} -->\n<hr class="wp-block-separator has-text-color has-background is-style-wide" style="background-color:#000000;color:#000000" />\n<!-- /wp:separator --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column -->\n<div class="wp-block-column"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:paragraph {"style":{"color":{"text":"#000000"}},"fontSize":"extra-small"} -->\n<p class="has-text-color has-extra-small-font-size" style="color:#000000">Winding veils round their heads, the women walked on deck. They were now moving steadily down the river, passing the dark shapes of ships at anchor, and London was a swarm of lights with a pale yellow canopy drooping above it. There were the lights of the great theatres, the lights of the long streets, lights that indicated huge squares of domestic comfort, lights that hung high in air.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:paragraph {"style":{"color":{"text":"#000000"}},"fontSize":"extra-small"} -->\n<p class="has-text-color has-extra-small-font-size" style="color:#000000">No darkness would ever settle upon those lamps, as no darkness had settled upon them for hundreds of years. It seemed dreadful that the town should blaze for ever in the same spot; dreadful at least to people going away to adventure upon the sea, and beholding it as a circumscribed mound, eternally burnt, eternally scarred. From the deck of the ship the great city appeared a crouched and cowardly figure, a sedentary miser.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {"height":40} -->\n<div style="height:40px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->";}i:39;O:8:"stdClass":7:{s:2:"id";i:196;s:5:"title";O:8:"stdClass":1:{s:8:"rendered";s:41:"Media and text in a full height container";}s:7:"content";O:8:"stdClass":2:{s:8:"rendered";s:1445:"\n<div class="wp-block-cover alignfull is-light" style="min-height:100vh"><span aria-hidden="true" class="wp-block-cover__background has-background-dim-100 has-background-dim" style="background-color:#ffffff"></span><div class="wp-block-cover__inner-container is-layout-flow wp-block-cover-is-layout-flow">\n<div class="wp-block-media-text alignwide is-stacked-on-mobile is-vertically-aligned-center is-image-fill" style="grid-template-columns:56% auto"><figure class="wp-block-media-text__media" style="background-image:url(https://s.w.org/images/core/5.8/soil.jpg);background-position:50% 50%"><img decoding="async" src="https://s.w.org/images/core/5.8/soil.jpg" alt="Close-up of dried, cracked earth." /></figure><div class="wp-block-media-text__content">\n<h2 class="wp-block-heading has-text-color" style="color:#000000;font-size:32px"><strong>What&#8217;s the problem?</strong></h2>\n\n\n\n<p class="has-text-color" style="color:#000000;font-size:17px">Trees are more important today than ever before. More than 10,000 products are reportedly made from trees. Through chemistry, the humble woodpile is yielding chemicals, plastics and fabrics that were beyond comprehension when an axe first felled a Texas tree.</p>\n\n\n\n<div class="wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex">\n<div class="wp-block-button is-style-fill"><a class="wp-block-button__link wp-element-button">Learn more</a></div>\n</div>\n</div></div>\n</div></div>\n";s:9:"protected";b:0;}s:4:"meta";O:8:"stdClass":7:{s:13:"wpop_keywords";s:0:"";s:16:"wpop_description";s:77:"Media and text block with image to the left and text and button