	(477, 100, 'sa_slide2_content', '<p><img class="size-full wp-image-88 alignnone" src="http://orchidee.test/wp-content/uploads/2023/05/Screen-Shot-2022-09-15-at-12.58-1.png" alt="" width="250" height="239" /></p>\r\n<h3 style="text-align: center"> </h3>\r\n<h3 style="text-align: center">Dera Siagian</h3>\r\n<p style="text-align: center"> Indonesian Idol Finalist, Singer</p>\r\n<p style="text-align: center"><br /> ”Always love coming here. The staff are so kind and helpful and I love the calm ambiance. Went here for my acne treatment and saw the doctor to consult on the suitable treatment for my skin type. They’re very professional and my skin is looking so much better now.”</p>'),
