	(491, 100, 'sa_slide3_content', '<p><img class="size-full wp-image-90 alignnone" src="http://orchidee.test/wp-content/uploads/2023/05/Screen-Shot-2021-10-14-at-12.29-2.png" alt="" width="250" height="238" /></p>\r\n<h3 style="text-align: center"> </h3>\r\n<h3 style="text-align: center">Destanya Zefanya</h3>\r\n<p style="text-align: center"> Fashion Stylist</p>\r\n<p style="text-align: center"> </p>\r\n<p style="text-align: center">”Tempatnya nyaman banget, dengan semua kualitas yg ada serasa perawatan di rumah sendiri. Dan tempat ini cukup private, apa lagi tempat ini menyediakan ruangan couple yg kapan saja aku bisa treatment bareng dengan sahabat sahabat aku.”</p>'),
