	(171, 1, '2023-05-08 13:43:39', '2023-05-08 13:43:39', '<!-- wp:query {"queryId":2,"query":{"perPage":3,"pages":0,"offset":0,"postType":"post","order":"desc","orderBy":"date","author":"","search":"","exclude":[],"sticky":"","inherit":false},"displayLayout":{"type":"list"}} -->\n<div class="wp-block-query"><!-- wp:post-template -->\n<!-- wp:post-title {"isLink":true} /-->\n\n<!-- wp:post-featured-image {"isLink":true,"align":"wide"} /-->\n\n<!-- wp:post-excerpt /-->\n\n<!-- wp:separator {"opacity":"css"} -->\n<hr class="wp-block-separator has-css-opacity"/>\n<!-- /wp:separator -->\n\n<!-- wp:post-date /-->\n<!-- /wp:post-template --></div>\n<!-- /wp:query -->', 'Blog', '', 'inherit', 'closed', 'closed', '', '15-revision-v1', '', '', '2023-05-08 13:43:39', '2023-05-08 13:43:39', '', 15, 'http://orchidee.test/?p=171', 0, 'revision', '', 0),
	(173, 1, '2023-05-08 13:58:41', '2023-05-08 13:58:41', '<!-- wp:heading -->\n<h2 class="wp-block-heading">ACNE FACIAL</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Perawatan Kulit Wajah spesifik untuk Mengatasi jerawat dan komedo yang berlebih pada wajah dengan menggunakan peppermint and white clay pureness mask, dan peppermint pureness gel Paris yang mencerahkan wajah dan mencegah timbulnya jerawat dan komedo baru.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Hitech glowing facial</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Injeksi rapid acne dilakukan pada jerawat yang masih aktif, diinjeksi obat anti-acne yang dapat mengeringkan jerawat dan mengurangi resiko scars (luka bekas jerawat) sehingga wajah terbebas dari noda dan luka bekas jerawat. Tingkat kesembuhan untuk jenis kulit normal sekitar 1-2 hari.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">hidrating &amp; rejuvenating facial</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Anti-acne infusion dilakukan untuk mengurangi timbulnya jerawat, Membantu penyembuhan jerawat dengan menginfuskan antioksidan pada pembuluh darah. Lama pengerjaan sekitar 30-40 menit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">ultimate therapy facial</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Salah satu perawatan wajah populer untuk mencegah penuaan dini adalah PRP facial. Seringkali disebut "vampire facial", perawatan wajah ini menggunakan plasma sebagai bahannya. Platelet rich plasma (PRP) atau plasma kaya trombosit merupakan produk yang berasal dari tubuh sendiri. PRP diperoleh dengan mengambil sejumlah kecil darah sendiri yang diproses dengan setrifugasi untuk memisahkan komponen sel-sel darah dengan plasma dan trombosit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Bright &amp; glowing PEELING</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Salah satu perawatan wajah populer untuk mencegah penuaan dini adalah PRP facial. Seringkali disebut "vampire facial", perawatan wajah ini menggunakan plasma sebagai bahannya. Platelet rich plasma (PRP) atau plasma kaya trombosit merupakan produk yang berasal dari tubuh sendiri. PRP diperoleh dengan mengambil sejumlah kecil darah sendiri yang diproses dengan setrifugasi untuk memisahkan komponen sel-sel darah dengan plasma dan trombosit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">ACNE Exfoliate PEELING</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Salah satu perawatan wajah populer untuk mencegah penuaan dini adalah PRP facial. Seringkali disebut "vampire facial", perawatan wajah ini menggunakan plasma sebagai bahannya. Platelet rich plasma (PRP) atau plasma kaya trombosit merupakan produk yang berasal dari tubuh sendiri. PRP diperoleh dengan mengambil sejumlah kecil darah sendiri yang diproses dengan setrifugasi untuk memisahkan komponen sel-sel darah dengan plasma dan trombosit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">ACNE PEELING</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Salah satu perawatan wajah populer untuk mencegah penuaan dini adalah PRP facial. Seringkali disebut "vampire facial", perawatan wajah ini menggunakan plasma sebagai bahannya. Platelet rich plasma (PRP) atau plasma kaya trombosit merupakan produk yang berasal dari tubuh sendiri. PRP diperoleh dengan mengambil sejumlah kecil darah sendiri yang diproses dengan setrifugasi untuk memisahkan komponen sel-sel darah dengan plasma dan trombosit.</p>\n<!-- /wp:paragraph -->', 'FACIAL &amp; PEELING', '', 'publish', 'open', 'open', '', 'facial-peeling', '', '', '2023-05-19 09:00:30', '2023-05-19 09:00:30', '', 0, 'http://orchidee.test/?p=173', 0, 'post', '', 0),
