	(204, 1, '2023-05-12 16:55:48', '2023-05-12 16:55:48', '<!-- wp:heading -->\n<h2 class="wp-block-heading">ACNE PURIFYING FACIAL</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Perawatan Kulit Wajah spesifik untuk Mengatasi jerawat dan komedo yang berlebih pada wajah dengan menggunakan peppermint and white clay pureness mask, dan peppermint pureness gel Paris yang mencerahkan wajah dan mencegah timbulnya jerawat dan komedo baru.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {"style":{"typography":{"textTransform":"uppercase"}}} -->\n<h2 class="wp-block-heading" style="text-transform:uppercase">Rapid ACNE injection</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Injeksi rapid acne dilakukan pada jerawat yang masih aktif, diinjeksi obat anti-acne yang dapat mengeringkan jerawat dan mengurangi resiko scars (luka bekas jerawat) sehingga wajah terbebas dari noda dan luka bekas jerawat. Tingkat kesembuhan untuk jenis kulit normal sekitar 1-2 hari.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {"style":{"typography":{"textTransform":"uppercase"}}} -->\n<h2 class="wp-block-heading" style="text-transform:uppercase">ANti-ACNE infusion</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Anti-acne infusion dilakukan untuk mengurangi timbulnya jerawat, Membantu penyembuhan jerawat dengan menginfuskan antioksidan pada pembuluh darah. Lama pengerjaan sekitar 30-40 menit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {"style":{"typography":{"textTransform":"uppercase"}}} -->\n<h2 class="wp-block-heading" style="text-transform:uppercase">PRP (Vampire facial)</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Salah satu perawatan wajah populer untuk mencegah penuaan dini adalah PRP facial. Seringkali disebut "vampire facial", perawatan wajah ini menggunakan plasma sebagai bahannya. Platelet rich plasma (PRP) atau plasma kaya trombosit merupakan produk yang berasal dari tubuh sendiri. PRP diperoleh dengan mengambil sejumlah kecil darah sendiri yang diproses dengan setrifugasi untuk memisahkan komponen sel-sel darah dengan plasma dan trombosit.</p>\n<!-- /wp:paragraph -->', 'SELULIT & STRETCH MARK', '', 'inherit', 'closed', 'closed', '', '202-revision-v1', '', '', '2023-05-12 16:55:48', '2023-05-12 16:55:48', '', 202, 'http://orchidee.test/?p=204', 0, 'revision', '', 0),
	(205, 1, '2023-05-12 16:57:23', '2023-05-12 16:57:23', '<!-- wp:heading {"style":{"typography":{"textTransform":"uppercase"}}} -->\n<h2 class="wp-block-heading" style="text-transform:uppercase">SKIN Whitening and glowing Treatment</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Pemberian Injeksi/infuse antioksidan, kolagen yang dikombinasikan dengan Vitamin C dengan dosis tertentu sehingga membuat cerah dan sehat kulit kamu. Treatment ini dilakukan dan diawasi pemakaiannya oleh dokter kami. Diperlukan beberapa kali treatment untuk mendapatkan hasil yang diinginkan.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {"style":{"typography":{"textTransform":"uppercase"}}} -->\n<h2 class="wp-block-heading" style="text-transform:uppercase">Tindakan SKIN BOOSTER</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Skinbooster merupakan salah satu tindakan perawatan kulit dengan menyuntikkan hyaluronic acid (HA) atau DNA Salmon atau supplemen vitamin* dengan dosis tertentu ke lapisan kulit dengan tujuan menstimulasi produksi kolagen sehingga kulit kerutan pada area yang disuntikkan akan berkurang, meratakan warna kulit wajah, mengecilkan pori-pori wajah serta mencerahkan wajah,</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>*Tergantung jenis dan merk yang digunakan</p>\n<!-- /wp:paragraph -->', 'MISS V TREATMENT', '', 'publish', 'open', 'open', '', 'miss-v-treatment', '', '', '2023-05-12 16:57:34', '2023-05-12 16:57:34', '', 0, 'http://orchidee.test/?p=205', 0, 'post', '', 0),
