	(213, 1, '2023-05-14 23:15:32', '2023-05-14 23:15:32', '[sample_long_desc]', 'Sample Product Page', '<p>Welcome on a product test page. This is a short description. It should show up on the left side of the product image and below the product name.</p><p>You can change the product page template in catalog settings.</p><p><strong>Please read this page carefully to fully understand all product page elements.</strong></p>', 'publish', 'closed', 'closed', '', 'sample-product-page', '', '', '2023-05-14 23:15:32', '2023-05-14 23:15:32', '', 0, 'http://orchidee.test/?p=213', 0, 'al_product', '', 0),
