	(318, 1, '2023-05-18 12:43:45', '2023-05-18 12:43:45', '<!-- wp:group {"className":"odb_about-content-group","layout":{"type":"constrained"}} -->\n<div class="wp-block-group odb_about-content-group"><!-- wp:spacer {"height":"50px"} -->\n<div style="height:50px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"level":3,"style":{"typography":{"letterSpacing":"0.33em","textTransform":"uppercase","fontSize":"24px","fontStyle":"normal","fontWeight":"600"},"color":{"text":"#762d5a"}}} -->\n<h3 class="wp-block-heading has-text-color" style="color:#762d5a;font-size:24px;font-style:normal;font-weight:600;letter-spacing:0.33em;text-transform:uppercase">About Orchidée</h3>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"50px"} -->\n<div style="height:50px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:image {"id":282,"sizeSlug":"full","linkDestination":"none","className":"odb_image-full"} -->\n<figure class="wp-block-image size-full odb_image-full"><img src="http://orchidee.test/wp-content/uploads/2023/05/spring-beauty-portrait-photo-two-women-nature-2.png" alt="" class="wp-image-282"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {"height":"70px"} -->\n<div style="height:70px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns -->\n<div class="wp-block-columns"><!-- wp:column {"width":"730px"} -->\n<div class="wp-block-column" style="flex-basis:730px"><!-- wp:heading {"style":{"typography":{"textTransform":"uppercase","fontStyle":"normal","fontWeight":"700","letterSpacing":"0.33em"},"color":{"text":"#762d5a"}},"fontSize":"large"} -->\n<h2 class="wp-block-heading has-text-color has-large-font-size" style="color:#762d5a;font-style:normal;font-weight:700;letter-spacing:0.33em;text-transform:uppercase">The Beauty Partner You can trust</h2>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"70px"} -->\n<div style="height:70px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"level":4,"style":{"typography":{"textTransform":"uppercase","fontStyle":"normal","fontWeight":"600","letterSpacing":"0.045em","fontSize":"21px"}}} -->\n<h4 class="wp-block-heading" style="font-size:21px;font-style:normal;font-weight:600;letter-spacing:0.045em;text-transform:uppercase">Orchidée de beauté, merupakan salah satu pelopor klinik estetika di Jakarta. Pertama berdiri tahun 2004 dengan nama Nujaniv de Beauté.</h4>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"20px"} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>Kemudian pada tahun 2019 Nujaniv de Beauté berganti nama menjadi Orchidée de beauté. Nama yang diambil dari bahasa Perancis yang berarti bunga Anggrek.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":"20px"} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"15px","letterSpacing":"0.045em","textTransform":"none"}}} -->\n<p style="font-size:15px;letter-spacing:0.045em;text-transform:none">Orchidée memiliki arti daya tarik, pesona, kecantikan serta keanggunan. Maka lewat filosofi ini, Orchidée de beauté ingin kamu bisa mendapatkan kembali pesona diri kamu. Dengan pengalaman lebih dari 10 tahun, kami ingin selalu memberikan service terbaik buat kamu, sehingga kamu dapat merasakan hasil sesuai dengan yang kamu inginkan juga kenyamanan selama melakukan perawatan di klinik kami.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":"20px"} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"15px","letterSpacing":"0.045em","textTransform":"none"}}} -->\n<p style="font-size:15px;letter-spacing:0.045em;text-transform:none">Lokasi kami masih di Gedung Kemang Seven Lantai 3 Jl. Kemang Raya No.7 Kemang Jakarta Selatan. Telepon +62 21 718 2028 atau via WhatsApp di +62 8211 498 8818<br></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {"height":"70px"} -->\n<div style="height:70px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"textAlign":"center","level":5,"style":{"typography":{"fontStyle":"normal","fontWeight":"400","letterSpacing":"0.68em","fontSize":"18px"}}} -->\n<h5 class="wp-block-heading has-text-align-center" style="font-size:18px;font-style:normal;font-weight:400;letter-spacing:0.68em">LOCATION</h5>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"40px"} -->\n<div style="height:40px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"textAlign":"center","style":{"typography":{"textTransform":"uppercase","fontSize":"48px","fontStyle":"normal","fontWeight":"600","letterSpacing":"0.115em"}}} -->\n<h2 class="wp-block-heading has-text-align-center" style="font-size:48px;font-style:normal;font-weight:600;letter-spacing:0.115em;text-transform:uppercase">our location</h2>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"60px"} -->\n<div style="height:60px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\n\n<!-- wp:html -->\n<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3966.066023447321!2d106.80745046476932!3d-6.255032445472447!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e69f129ce699b1d%3A0xee97925414af4e8!2sKlinik%20Kecantikan%20Orchid%C3%A9e%20de%20Beaut%C3%A9!5e0!3m2!1sen!2sid!4v1683348688158!5m2!1sen!2sid" style="border:0;width: 100%; height: 70vh" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>\n<!-- /wp:html -->', 'TENTANG KAMI', '', 'inherit', 'closed', 'closed', '', '281-revision-v1', '', '', '2023-05-18 12:43:45', 