	(347, 1, '2023-05-18 15:33:46', '2023-05-18 15:33:46', '<!-- wp:spacer {"height":"70px"} -->\n<div style="height:70px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"className":"odb_about-group"} -->\n<div class="wp-block-columns odb_about-group"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"style":{"typography":{"textTransform":"uppercase","letterSpacing":"0.33em","fontStyle":"normal","fontWeight":"700","fontSize":"48px"},"color":{"text":"#762d5a"}}} -->\n<h2 class="wp-block-heading has-text-color" style="color:#762d5a;font-size:48px;font-style:normal;font-weight:700;letter-spacing:0.33em;text-transform:uppercase">hubungi kami</h2>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"30px"} -->\n<div style="height:30px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"level":3,"style":{"typography":{"textTransform":"uppercase","fontSize":"24px","letterSpacing":"0.045em","fontStyle":"normal","fontWeight":"600"}}} -->\n<h3 class="wp-block-heading" style="font-size:24px;font-style:normal;font-weight:600;letter-spacing:0.045em;text-transform:uppercase">kamu punya masalah atau pertanyaan seputar kecantikan atau kesehatan kulit?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:spacer {"height":"20px"} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"letterSpacing":"0.045em","fontSize":"18px"}}} -->\n<p style="font-size:18px;letter-spacing:0.045em">Jangan malu atau ragu untuk Hubungi kami melalui channel yang tersedia, staff kami akan segera membantu kamu menjawab pertanyaan-pertanyaan yang kalian miliki.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":"20px"} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px","letterSpacing":"0.045em"}}} -->\n<p style="font-siz